INSERT INTO `oa_news` VALUES ('3', '1', 'iOS-VRView ', '', '<p>FacebookSwift MeetupGoogle VR-SDK </p><h1> iOS-VR </h1><p>VR<a href=\"https://www.oculus.com/\" target=\"_blank\">Oculus</a>iOS</p><blockquote>Oculus powers the Samsung Gear VR, the most widely distributed VR headset in the world. Supported by Samsungs global distribution and marketing efforts, Gear VR is compatible with the tens of millions of Samsung GALAXY flagship smartphones, including S7, S7 edge, S6, S6 edge, S6 edge +, and Note 5.</blockquote><p>VRCore-MotionGoogleiOSGoogle-VRSDK</p><p>VRVR????</p><h1>Google VRView</h1><p>Google VRView</p><blockquote>VR view allows you to embed 360 degree VR media into websites on desktop and mobile, and native apps on Android and iOS. This technology is designed to enable developers of traditional apps to enhance the apps with immersive content. For example, VR view makes it easy for a travel app to provide viewers with an underwater scuba diving tour as they plan a vacation or for a home builder to take prospective buyers on a virtual walkthrough before the home is built.</blockquote><pre>pod&nbsp;\'GVRSDK\'&nbsp;//cocoapods&nbsp;iOScocoapods.......</pre><p><a href=\"https://developers.google.com/vr/ios/reference/\" target=\"_blank\"></a></p><p>Google VRView GVRCardboardViewGVRWidgetViewGVRPanoramaViewGVRVideoView</p><blockquote>GVRCardboardView&nbsp;&nbsp;Defines a view responsible for rendering graphics in VR modeGVRWidgetView &nbsp;&nbsp;Defines a base class for all widget views, that encapsulates common functionalityGVRPanoramaView&nbsp;&nbsp; &nbsp;Defines a view that can load and display 360-degree panoramic photosGGVRVideoView &nbsp;&nbsp;Defines a player view that renders a 360 video using OpenGL</blockquote><p>GVRCardboardView 3DOpenGLSceneKitGVRPanoramaViewGVRVideoView</p><p>ViewGVRPanoramaView </p><blockquote>GVRPanoramaView Inherits() GVRWidgetView Inherits() UIView</blockquote><p>step1storyboardUIViewController</p><p><img src=\"http://cc.cocimg.com/api/uploads/20161101/1477965029424622.png\" alt=\"2751003-65554e23c12a7445.png\"></p><pre>@IBOutlet&nbsp;weak&nbsp;var&nbsp;panoView:&nbsp;GVRPanoramaView!\npanoView.enableFullscreenButton&nbsp;=&nbsp;truepanoView.enableCardboardButton&nbsp;=&nbsp;truepanoView.enableTouchTracking&nbsp;=&nbsp;truepanoView.load(UIImage(named:&nbsp;\"\"),&nbsp;of:&nbsp;.stereoOverUnder)</pre><table><thead><tr><th>Property</th><th></th></tr></thead><tbody><tr><td><gvrwidgetviewdelegate>delegate</gvrwidgetviewdelegate></td><td>The delegate that is called when the widget view is loaded.</td></tr><tr><td>enableFullscreenButton</td><td>fullScreen </td></tr><tr><td>enableCardboardButton</td><td> cardboard </td></tr><tr><td>enableTouchTracking</td><td></td></tr></tbody></table><p><img src=\"http://cc.cocimg.com/api/uploads/20161101/1477965052750113.png\" alt=\"2751003-ebf536633ff3b973.png\"></p><p></p><p> displayMode</p><blockquote>displayMode: &nbsp;Controls the current GVRWidgetDisplayMode of the widget view.Changing the value of this property is similar to pressing one of the fullscreen, cardboard or back UI buttons.</blockquote><p>VR</p><p>Delegate</p><pre>panoView.delegate&nbsp;=&nbsp;self</pre><pre>extension&nbsp;VRViewController:&nbsp;GVRWidgetViewDelegate&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;func&nbsp;widgetViewDidTap(widgetView:&nbsp;GVRWidgetView!)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//Called&nbsp;when&nbsp;the&nbsp;user&nbsp;taps&nbsp;the&nbsp;widget&nbsp;view.\n&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;func&nbsp;widgetView(widgetView:&nbsp;GVRWidgetView!,&nbsp;didLoadContent&nbsp;content:&nbsp;AnyObject!)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//Called&nbsp;when&nbsp;the&nbsp;widget&nbsp;view\'s&nbsp;display&nbsp;mode&nbsp;changes.\n&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;func&nbsp;widgetView(widgetView:&nbsp;GVRWidgetView!,&nbsp;didChangeDisplayMode&nbsp;displayMode:&nbsp;GVRWidgetDisplayMode)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//Called&nbsp;when&nbsp;the&nbsp;content&nbsp;is&nbsp;successfully&nbsp;loaded.&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;func&nbsp;widgetView(widgetView:&nbsp;GVRWidgetView!,&nbsp;didFailToLoadContent&nbsp;content:&nbsp;AnyObject!,&nbsp;withErrorMessage&nbsp;errorMessage:&nbsp;String!)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//Called&nbsp;when&nbsp;there&nbsp;is&nbsp;an&nbsp;error&nbsp;loading&nbsp;content&nbsp;in&nbsp;the&nbsp;widget&nbsp;view.\n&nbsp;&nbsp;&nbsp;&nbsp;}\n}</pre><p>widgetViewDidTap</p><pre>func&nbsp;widgetViewDidTap(widgetView:&nbsp;GVRWidgetView!)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;panoView?.load(UIImage(named:&nbsp;\"\"),&nbsp;of:&nbsp;GVRPanoramaImageType.mono)\n&nbsp;&nbsp;&nbsp;&nbsp;}</pre><p>GVRPanoramaImageTypemonostereoOverUnder.</p><p><img src=\"http://cc.cocimg.com/api/uploads/20161101/1477965100279973.png\" alt=\"2751003-ecf72fb796c09c77.png\"></p><p></p>&nbsp;<code>GVRWidgetDisplayMode</code><p></p><br><table><thead><tr><th>Type</th><th></th></tr></thead><tbody><tr><td>.embedded</td><td>View</td></tr><tr><td>.fullscreen</td><td></td></tr><tr><td>.fullscreenVR</td><td></td></tr></tbody></table><p>ViewGVRWidgetDisplayMode.</p><p>Video</p><p>Ray<a href=\"https://www.raywenderlich.com/136692/introduction-google-cardboard-ios\" target=\"_blank\">Introduction to Google Cardboard for iOS</a><a href=\"https://koenig-media.raywenderlich.com/uploads/2016/08/Vacation_360_final.zip\" target=\"_blank\"></a>Demo</p><br><p><br></p>', 'http://shencai-img.oss-cn-shanghai.aliyuncs.com/790c4e6d-3f5d-4353-8c5b-5c586d46648e.jpg', '1', '2016-11-01 11:44:39', '2016-11-18 15:39:55');
